import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function ExpenseDisplay(props) {    

  return (
    <div className="expense">
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
    </div>
  );
}

export default ExpenseDisplay;
